import "./App.css";
import { useState } from "react";

function App() {
  const [name, setName] = useState("Suresh");
  const [events, setEvents] = useState([
    { title: "Jason wedding anniversary!", id: "1" },
    { title: "Raghu birthday!", id: "2" },
  ]);
  return (
    <div className="App">
      <h1>Hi there! my name is {name}</h1>
      <button
        onClick={() => {
          setName("SKY");
        }}
      >
        Change the Name!
      </button>
      {events.map((item, index) => (
        <p key={item.id}>
          {index}
          {item.title}
        </p>
      ))}
    </div>
  );
}

export default App;
